/**
 * Allocates a new byte array, copies the payload data into it and returns it. 
 */
public byte[] toByteArray() {
  byte[] retArray = new byte[this.length];
  System.arraycopy(this.data, this.offset, retArray, 0, this.length);
  return retArray;
}

